import Classes from "./";

const Cloud = () => {
  return (
    <svg className={Classes.cloud} viewBox="0 0 105 105">
      <path
        d="M 25,60 
           a 20,20 1 0,0 0,40 
           h 50 
           a 20,20 1 0,0 0,-40 
           a 10,10 1 0,0 -15,-10 
           a 15,15 1 0,0 -35,10  
           z"
      />
    </svg>
  );
};

export default Cloud;
